export default function AdicionarHospedagem() {
  return (
    <div>
      <h1>Adicionar hospedagem</h1>
      <form onSubmit={handleSubmit}>
        <label>
          Name
          <input
            type="text"
            name="name"
            value={this.nameIn}
            onChange={this.handleNameChange}
          />
        </label>
        <label>
          quote
          <input
            type="text"
            name="quote"
            value={this.quoteIn}
            onChange={this.handleQuoteChange}
          />
        </label>
        <input type="submit" value="Add to DB" />
      </form>
    </div>
  );
}
